DROP TABLE IF EXISTS LabExam2_Hotel;

create table LabExam2_Hotel (
	bookingID VARCHAR(50) NOT NULL,
	guestname TEXT  NOT NULL,
	check_in DATE  NOT NULL,
	check_out DATE  NOT NULL,
	guests INTEGER  NOT NULL,
	payment VARCHAR(13),
	booking VARCHAR(15),
	CONSTRAINT LabExam2_Hotel_PK PRIMARY KEY (bookingID)
);

drop table if exists LabExam2_Stores CASCADE;
DROP TABLE IF EXISTS LabExam2_Supplier CASCADE;	
	DROP TABLE IF EXISTS LabExam2_Supplies CASCADE;


create table LabExam2_Stores (
	storeID VARCHAR(50),
	storeName TEXT NOT NULL,
	department TEXT NOT NULL,
	phone VARCHAR(50),
	state VARCHAR(50),
	CONSTRAINT LabExam2_Stores_PK PRIMARY KEY (storeID)
);



create table LabExam2_Supplier (
	SupplierID TEXT NOT NULL,
	SupplierName TEXT NOT NULL,
	Manager TEXT NOT NULL,
	SupplierRating REAL NOT NULL,
	SupplierState VARCHAR(50),
	CONSTRAINT LabExam2_Supplier_PKEY PRIMARY KEY (SupplierID)
);


	
	CREATE TABLE LabExam2_Supplies (
		SupplierID TEXT NOT NULL References LabExam2_Supplier (SupplierID) ON UPDATE CASCADE ON DELETE CASCADE,
		StoreID TEXT NOT NULL References LabExam2_Stores (StoreID) ON UPDATE CASCADE ON DELETE CASCADE,
		CONSTRAINT LabExam2_Supplies_PK PRIMARY KEY (SupplierID,StoreID)	
	);
	
	


