UPDATE labexam2_hotel
SET guests = guests -1
WHERE booking = 'Room Only' AND guests>2;

SELECT * FROM labexam2_hotel WHERE (check_in BETWEEN '2017-10-01' AND '2017-10-31') AND (check_out BETWEEN '2017-10-01' AND '2017-10-31') AND (check_out - check_in >=6);
DELETE FROM labexam2_hotel WHERE (check_in BETWEEN '2017-10-01' AND '2017-10-31') AND (check_out BETWEEN '2017-10-01' AND '2017-10-31') AND (check_out - check_in >6);

