WHERE st.storeid = j.storeid AND su.supplierid = j.supplierid
AND st.department ~* '(Computers|Kids|Industrial|Home)' AND supplierrating >= 8.5;

SELECT * 
FROM labexam2_stores AS ST, labexam2_supplier AS SU, labexam2_supplies AS J
WHERE st.storeid = j.storeid AND su.supplierid = j.supplierid
AND st.state ~*'Ohio' AND st.department ~*'Garden' 
